import React from 'react';
import EmojiPicker from 'emoji-picker-react';

export default function messagingSend() {
    return (
        <div className="messagingSend">
            <div id="send">
                <textarea className="sendInput"></textarea>
                <div className="submit"><span>Send</span></div>
                <div className="emojiButton"><img src="./icons/icons_alien.png" className="emojiButton" /> </div>
                <EmojiPicker onEmojiClick={myCallback} />
            </div>
        </div>
    )
}
